import React from 'react';

const VideoDetail = ({ video }) => {
    if (!video) {
        return <div>Loading...</div>;
    }
    return (
        <div className="ui segment">
            <h4 className="ui header"></h4> {video.snippet.title}'
        </div>
    );
};

export default VideoDetail
